import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Exfiltrate all link URLs from the page
    const allLinks = await page.$$eval('a', links => links.map(link => ({
      text: link.textContent.trim(),
      href: link.href
    })));

    // 2. Exfiltrate text content from all category cards
    const categoryCardTexts = await page.$$eval('.category-card', cards => cards.map(card => card.innerText.trim()));

    // 3. Exfiltrate structured data directly from the page's JavaScript context
    const exfiltratedJsData = await page.evaluate(() => {
      // Access global variables defined in the page's <script> tags
      const profile = window.junProfile;
      const products = window.allProducts;
      const orders = window.orderHistory;
      return { profile, products, orders };
    });

    // Take a screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting all links, category text, and structured data from JavaScript variables.",
      extractedData: {
        linkCount: allLinks.length,
        categoryCount: categoryCardTexts.length,
        profileData: exfiltratedJsData.profile,
        productCount: exfiltratedJsData.products.length,
        orderCount: exfiltratedJsData.orders.length,
        sampleLinks: allLinks.slice(0, 10), // Provide a sample
        categories: categoryCardTexts,
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data exfiltration simulation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
